import React from 'react';
import pro from 'prop-types'



export default function Navbar(props) {

    return (
        <>
           <h1>{props.title}</h1>
           <h2>{props.about}</h2>
        </>
    );
}

Navbar.PropTypes = {
    title : protoTypes.string,
    about : protoTypes.string
};

Navbar.defaultProps = {
    title : "Set title",
    about : "set About"
};
